import { router } from 'kea-router'
import { urls } from 'scenes/urls'

export default {
    title: 'Scenes-Other/Billing',
    parameters: { layout: 'fullscreen', options: { showPanel: false }, viewMode: 'canvas' },
    decorators: [
        mswDecorator({
            get: {
                '/_preflight': {
                    ...preflightJson,
                    cloud: true,
                    realm: 'cloud',
                },
            },
        }),
    ],
} as Meta

