export function LemonSwitch_(props: LemonSwitchProps): JSX.Element {
    const [isChecked, setIsChecked] = useState(false)

    return (
        <LemonSwitch
            {...props}
            checked={props.checked !== undefined ? props.checked : isChecked}
            onChange={setIsChecked}
        />
    )
}
